import React from 'react';
import TopBar from './TopBar.js'
import Widget from './Widget.js';

export default function PageLayout({children}) {
    return (
        <div style={{
            position: 'absolute',
            top: '0',
            left: '0',
            height: '100vh',
            display: 'flex',
            flexDirection: 'column',
            overflow: 'hidden',
            border: '1px solid red'
        }}>
            <TopBar></TopBar>
            <div style={{
                display: 'flex',
                flexDirection: 'column',
                border: '1px solid blue',
                overflow: 'scroll'
            }}>
                <div style={{
                    display: 'flex',
                    position: 'absolute'
                }}>
                    <Widget>
                        A a B b C c
                    </Widget>
                    <Widget>
                        <input type="text" />
                    </Widget>
                </div>
                <div aria-hidden="true" style={{
                    visibility: 'hidden'
                }}>
                    <Widget>A</Widget>
                </div>
                {children}
            </div>
        </div>
    );
}
